import React    from 'react';


import './Body.css'
import HookMqtt from '../Hook/index'
// import Histogram from '../D3/Histogram'
import Chart from '../D3/Chart/Chart'

import dataTsv from '../D3/Chart/dataChart'

const data = tsvParse(dataTsv, (d, _, columns) => {
	d.date = parseTime(d.date);
	for (let i = 1, n = columns.length, c; i < n; ++i)
		d[(c = columns[i])] = +d[c];
	return d;
});

function BodyContent(props) {
    return (
        <div id="body-div" >
            {/* <div className = "site-layout-background" style = {{ padding: 24, minHeight: '100vh' }} > */}
            <div className="container-fluid" style = {{ padding: 24, minHeight: '100vh' }}>
				<HookMqtt id='mqtt' />
                <Chart props={data} />
			</div>
            {/* </div> */}
        </div>
    );
}

export default BodyContent;
